import Head from 'next/head';
import Navbar from './Navbar';

const Layout = (props) => (
  <div>
    <Head>
      <title>BitzPrice</title>
    </Head>
    <Navbar/>
    <div className="container">
      {props.children}
    </div>
    <style jsx global>
      {`
      body {background-color: coral;}
      `}
    </style>
  </div>
);

export default Layout;
